import React from "react";

const Result = (props) => {
  const mappedData = props.type.map((element, index) => {
    return (
      <div key={index}>
        <p>element.price</p>
        <p>element.unit</p>
      </div>
    );
  });
  return <div></div>;
};

export default Result;
